import React, { useState, useEffect } from 'react';

const Counter = () => {
    const [count, setCount] = useState(0);

    useEffect(() => {
        document.title = `${count} click(s)`;
    });

    const upCount = () => {
        setCount(count + 1);
    }

    const downCount = () => {
        setCount(count - 1);
    }

    return (
        <div>
            <h1>{count}</h1>

            <select id = 'multiplier'>
                <option>1</option>
                <option>2</option>
                <option>5</option>
                <option>10</option>
                <option>25</option>
                <option>50</option>
                <option>100</option>
                <option>500</option>
                <option>1000</option>
            </select>

            <button onClick = {upCount}>Up Count</button>
            <button onClick = {downCount}>Down Count</button>
        </div>
    )
}

export default Counter;
